INSERT INTO $$ETLVWDB.WI_SMR_OPL_RENEW_ENRICH_DT_INC SELECT MINOR_LN_EXAAS_SUBSCR_SOL_KEY AS SALES_ORDER_LINE_KEY, SO_SBSCRPTN_ITM_SLS_TRX_KEY AS SO_SBSCRPTN_ITM_SLS_TRX_KEY, NEW_SERVICE_CONTRACT_START_DTM, NEW_SERVICE_CONTRACT_END_DTM, 'XAAS' AS TRANS_TYPE_CODE FROM (SELECT TSL.SO_SBSCRPTN_ITM_SLS_TRX_KEY, TSL.MINOR_LN_EXAAS_SUBSCR_SOL_KEY ,TSL.RU_SERVICE_CONTRACT_START_DTM ,TSL.RU_SERVICE_CONTRACT_END_DTM ,TSL.DV_CONTRACT_DURATION ,'N' AS XCAT_FLAG ,'N' AS ACV_POLICY_FLG, -- SUB look up CASE WHEN (SUB.TERM_START_DT >='2000-01-01' AND SUB.TERM_START_DT <> '3500-01-01') THEN SUB.TERM_START_DT END AS SUB_TERM_START_DT, CASE WHEN (SUB.TERM_END_DT <> '1900-01-01' AND SUB.TERM_END_DT <> '3500-01-01' AND SUB.TERM_END_DT <= Add_Months(Current_Date,240) ) THEN SUB.TERM_END_DT END AS SUB_TERM_END_DT, CASE WHEN (SUB.SUBSCRIPTION_END_DT <> '1900-01-01' AND SUB.SUBSCRIPTION_END_DT <> '3500-01-01' AND SUB.SUBSCRIPTION_END_DT <= Add_Months(Current_Date,240) ) THEN SUB.SUBSCRIPTION_END_DT END AS SUB_END_DT, SUB.INITIAL_TERM_MONTHS_CNT AS SUB_INITIAL_TERM, SUB.RENEWAL_TERM_MONTHS_CNT AS SUB_RENEWAL_TERM, SUB.SUBSCRIPTION_RENEW_CNT AS SUB_RENEWAL_CNT, CASE WHEN SUB_RENEWAL_CNT > 0 THEN SUB_RENEWAL_TERM ELSE SUB_INITIAL_TERM END AS SUB_CURRENT_TERM, -- TSL look up TSL.BK_SALES_ORDER_TYPE_CD AS TSL_ORDER_TYPE, TSL.BK_SALES_ORDER_SELL_TYPE_CD AS TSL_SELL_TYPE, TSL.ACTION_CD AS TSL_ACTION_CODE, CASE WHEN TSL.INITIAL_TERM_DUR_MTHS_CNT <> -999 AND TSL.INITIAL_TERM_DUR_MTHS_CNT <> 0 AND TSL.INITIAL_TERM_DUR_MTHS_CNT <= 240 THEN TSL.INITIAL_TERM_DUR_MTHS_CNT END AS TSL_INITIAL_TERM, CASE WHEN TSL.RENEWAL_TERM_MTHS_CNT <> -999 AND TSL.RENEWAL_TERM_MTHS_CNT <=240 THEN TSL.RENEWAL_TERM_MTHS_CNT ELSE 0 END AS TSL_RENEWAL_TERM, TSL.RENEWAL_CNT AS TSL_RENEWAL_CNT, CASE WHEN TSL_RENEWAL_CNT > 0 THEN Coalesce(SUB_RENEWAL_TERM, TSL_RENEWAL_TERM) ELSE Coalesce(SUB_INITIAL_TERM, TSL_INITIAL_TERM) END AS TSL_CURRENT_TERM, Round((Cast(Coalesce(TSL_INITIAL_TERM,0) AS DECIMAL(15,6)) / 12) * 365) AS TSL_INITIAL_DAYS, Round((Cast(Coalesce(TSL_RENEWAL_TERM,0) AS DECIMAL(15,6)) / 12) * 365) AS TSL_RENEWAL_DAYS, Round((Cast(Coalesce(TSL_CURRENT_TERM, 0) AS DECIMAL(15,6)) / 12) * 365) AS TSL_CURRENT_TERM_DAYS, TSL_INITIAL_DAYS + (Coalesce(TSL_RENEWAL_CNT, 0) * TSL_RENEWAL_DAYS) AS TSL_TOTAL_DAYS, CASE WHEN TSL.BOOKING_TERM_MONTHS_CNT <> 0 AND NOT(TSL_ORDER_TYPE IN ('REPLACE') AND TSL_ACTION_CODE IN ('REMOVE', 'CANCEL') ) THEN TSL.BOOKING_TERM_MONTHS_CNT END AS TSL_BOOKING_TERM, Round((Cast(Coalesce(TSL_BOOKING_TERM,0) AS DECIMAL(15,6)) / 12) * 365) AS TSL_BOOKING_DAYS, CASE WHEN TSL_ORDER_TYPE IN ('REPLACE') AND TSL_ACTION_CODE NOT IN ('REMOVE', 'CANCEL') THEN 0 ELSE Coalesce(TSL.FULFILLMENT_TERM_DAYS_CNT, 0) END AS TSL_FULFILLMENT_DAYS, CASE WHEN TSL_FULFILLMENT_DAYS < TSL_CURRENT_TERM_DAYS THEN (TSL_CURRENT_TERM_DAYS - TSL_FULFILLMENT_DAYS) WHEN TSL_FULFILLMENT_DAYS >= TSL_CURRENT_TERM_DAYS AND TSL_FULFILLMENT_DAYS < TSL_TOTAL_DAYS THEN (TSL_TOTAL_DAYS - TSL_FULFILLMENT_DAYS) WHEN TSL_FULFILLMENT_DAYS >= TSL_CURRENT_TERM_DAYS AND TSL_FULFILLMENT_DAYS >= TSL_TOTAL_DAYS THEN 0 END AS TSL_REMAINING_DAYS, COALESCE(CASE WHEN TSL_REMAINING_DAYS > 0 THEN Cast(TSL_REMAINING_DAYS AS DECIMAL(15,6)) * 12 / 365 END ,0) AS TSL_REMAINING_TERM, COALESCE(CASE WHEN TSL_CURRENT_TERM_DAYS >= TSL_REMAINING_DAYS THEN (TSL_CURRENT_TERM_DAYS - TSL_REMAINING_DAYS) END ,0) AS DV_FULFILLMENT_DAYS, -- TSL Contract Duratiom CASE WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM >= TSL_REMAINING_TERM THEN TSL_BOOKING_TERM WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM < TSL_REMAINING_TERM AND TSL_FULFILLMENT_DAYS = 0 THEN TSL_BOOKING_TERM WHEN TSL_REMAINING_TERM >= 0 AND TSL_FULFILLMENT_DAYS > 0 THEN TSL_REMAINING_TERM ELSE TSL_CURRENT_TERM END AS TSL_CONTRACT_DURATION, -- Look up duration CASE WHEN TSL_CONTRACT_DURATION >= 0 THEN TSL_CONTRACT_DURATION ELSE TSL.DV_CONTRACT_DURATION END AS LKP_CONTRACT_DURATION, -- Subscription Effective Date CASE WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM >= TSL_REMAINING_TERM THEN (SUB_TERM_START_DT + DV_FULFILLMENT_DAYS) WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM < TSL_REMAINING_TERM AND TSL_FULFILLMENT_DAYS = 0 THEN (SUB_TERM_END_DT - TSL_BOOKING_DAYS) WHEN TSL_REMAINING_TERM > 0 AND TSL_FULFILLMENT_DAYS > 0 THEN (SUB_TERM_START_DT + DV_FULFILLMENT_DAYS) WHEN TSL_REMAINING_TERM = 0 AND SUB_END_DT >= SUB_TERM_END_DT THEN SUB_END_DT ELSE SUB_TERM_START_DT END AS SUB_EFFECTIVE_DATE, CASE WHEN (NSOL1.CUST_EXPECTED_START_DT >= '2000-01-01' AND NSOL1.CUST_EXPECTED_START_DT <> '3500-01-01') THEN NSOL1.CUST_EXPECTED_START_DT END AS SOL_REQUESTED_START_DT ,BOOKED_DT AS DV_BOOKED_DT ,Cast(DV_CONTRACT_DURATION AS DECIMAL(18,0)) AS CONTRACT_DURATION, -- Enriched Duration CASE WHEN ACV_POLICY_FLG = 'Y' THEN 12 ELSE LKP_CONTRACT_DURATION END AS NEW_CONTRACT_DURATION, -- Enriched Start Date CASE WHEN TSL_CONTRACT_DURATION >= 0 THEN COALESCE( SUB_EFFECTIVE_DATE, (COALESCE(SOL_CONTRACT_START_DT,SOL_REQUESTED_START_DT)+DV_FULFILLMENT_DAYS), DV_BOOKED_DT) WHEN DV_SVC_CONTRACT_DURATION > 0 THEN SVC_CONTRACT_START_DT WHEN DV_SOL_CONTRACT_DURATION > 0 THEN SOL_CONTRACT_START_DT WHEN SOLV1_CONTRACT_DURATION > 0 THEN COALESCE( SOL_CONTRACT_START_DT, SOL_REQUESTED_START_DT, DV_BOOKED_DT) ELSE DV_BOOKED_DT END AS NEW_SERVICE_CONTRACT_START_DTM, -- BSFT Change -- Enriched End Date CASE WHEN ACV_POLICY_FLG = 'Y' AND NEW_CONTRACT_DURATION = 12 THEN ADD_MONTHS( NEW_SERVICE_CONTRACT_START_DTM, 12) - 1 WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM >= TSL_REMAINING_TERM AND SUB_TERM_START_DT IS NOT NULL THEN (SUB_TERM_START_DT + DV_FULFILLMENT_DAYS + TSL_BOOKING_DAYS) WHEN TSL_BOOKING_TERM > 0 AND TSL_BOOKING_TERM < TSL_REMAINING_TERM AND TSL_FULFILLMENT_DAYS = 0 AND SUB_TERM_END_DT IS NOT NULL THEN SUB_TERM_END_DT WHEN TSL_REMAINING_TERM > 0 AND TSL_FULFILLMENT_DAYS > 0 AND SUB_TERM_END_DT IS NOT NULL THEN SUB_TERM_END_DT WHEN TSL_REMAINING_TERM = 0 AND SUB_END_DT >= SUB_TERM_END_DT THEN SUB_END_DT WHEN TSL_REMAINING_TERM IS NULL AND DV_SVC_CONTRACT_DURATION > 0 THEN SVC_CONTRACT_END_DT WHEN TSL_REMAINING_TERM IS NULL AND DV_SOL_CONTRACT_DURATION > 0 THEN SOL_CONTRACT_END_DT ELSE ( CASE WHEN FLOOR( NEW_CONTRACT_DURATION) = CEIL( NEW_CONTRACT_DURATION) AND NEW_CONTRACT_DURATION <> 0 THEN ADD_MONTHS( NEW_SERVICE_CONTRACT_START_DTM, CAST( NEW_CONTRACT_DURATION AS INTEGER)) - 1 ELSE NEW_SERVICE_CONTRACT_START_DTM + ROUND((CAST( NEW_CONTRACT_DURATION AS DECIMAL(15,6)) / 12) * 365) END ) END AS NEW_SERVICE_CONTRACT_END_DTM FROM (SELECT ROUND(CASE WHEN NXSSIS.ACQUISITION_ORDER_ORIGIN_CD IN 'ACQ-BSFT' AND NXSSIS.BOOKING_TERM_MONTHS_CNT>0 THEN NXSSIS.BOOKING_TERM_MONTHS_CNT WHEN NXSSIS.ACQUISITION_ORDER_ORIGIN_CD IN 'ACQ-BSFT' AND NXSSIS.BOOKING_TERM_MONTHS_CNT <=0 AND NXSSIS.DV_SERVICE_CONTRACT_START_DT IS NOT NULL AND NXSSIS.DV_SERVICE_CONTRACT_END_DT IS NOT NULL THEN CAST(((NXSSIS.DV_SERVICE_CONTRACT_END_DT-NXSSIS.DV_SERVICE_CONTRACT_START_DT+1)/365)*12 as decimal(15,6)) WHEN NXSSIS.BK_SALES_ORDER_TYPE_CD = 'AUTO-RENEWAL' THEN NXSSIS.RENEWAL_TERM_MTHS_CNT WHEN NXSSIS.INITIAL_TERM_DUR_MTHS_CNT > 0 THEN NXSSIS.INITIAL_TERM_DUR_MTHS_CNT WHEN ( NP.BK_PRODUCT_ID LIKE 'SWOA%' OR NP.BK_PRODUCT_ID LIKE '%ADJ%' ) AND NP.BK_PRODUCT_ID NOT LIKE 'SWOA-MX%' THEN NULL ELSE CASE WHEN NP.PRICING_UNIT_NAME = 'YEAR' THEN NP.PRICING_UNIT_DURATION_INT * 12 WHEN NP.PRICING_UNIT_NAME = 'MONTHS' THEN NP.PRICING_UNIT_DURATION_INT WHEN NP.PRICING_UNIT_NAME = 'DAYS' THEN CAST(((NP.PRICING_UNIT_DURATION_INT*12(FLOAT))/365) AS DECIMAL(15,6) ) WHEN EL.BIZ_DEF_TERM IS NOT NULL THEN EL.BIZ_DEF_TERM WHEN EL.DURATION IS NOT NULL THEN EL.DURATION ELSE NULL END END) DV_CONTRACT_DURATION,NXSSIS.* FROM (SELECT * FROM $$NRTNCRVWDB.N_XAAS_SO_SBCR_ITM_STRX_NRT_TV TV WHERE TV.END_TV_DTM= '3500-01-01 00:00:00' AND EXISTS (SELECT 1 FROM $$STGDB.WI_SMR_OPL_TRX_ID_TEMP TEMP WHERE TV.SK_TRX_ID_INT=TEMP.SK_ERP_BKGS_TRX_ID))NXSSIS INNER JOIN $$COMREFVWDB.N_PRODUCT NP ON (NP.ITEM_KEY = NXSSIS.SUBSCRIPTION_PRODUCT_KEY) LEFT OUTER JOIN (SELECT SKU,INVENTORY_ITEM_I